B.PP=new A.p6('L\u1ea5y t\xean t\u1eeb t\u1eeb c\xf3 ngu\u1ed3n g\u1ed1c t\u1eeb ti\u1ebfng Ph\u1ea1n c\xf3 ngh\u0129a l\xe0 "h\xf2a b\xecnh", Aman \u0111\xe3 tr\u1ea3i qua m\u1ed9t qu\xe1 tr\xecnh ph\xe1t tri\u1ec3n h\u1eefu c\u01a1 trong h\u01a1n ba th\u1eadp k\u1ef7 \u0111\u1ec3 tr\u1edf th\xe0nh m\u1ed9t trong nh\u1eefng th\u01b0\u01a1ng hi\u1ec7u khu ngh\u1ec9 d\u01b0\u1ee1ng, kh\xe1ch s\u1ea1n, n\u01a1i c\u01b0 tr\xfa v\xe0 phong c\xe1ch s\u1ed1ng ti\xean phong v\xe0 tr\u1ef1c quan nh\u1ea5t th\u1ebf gi\u1edbi. H\xe0nh tr\xecnh c\u1ee7a Aman, d\xf9 tr\u1ea3i nghi\u1ec7m \u1edf m\u1ed9t trong 34 \u0111i\u1ec3m \u0111\u1ebfn hay \u1edf nh\xe0, \u0111\u1ec1u \u0111\u01b0\u1ee3c l\u1ea5y c\u1ea3m h\u1ee9ng t\u1eeb m\u1ed9t m\u1ee5c \u0111\xedch duy nh\u1ea5t v\xe0 nguy\xean b\u1ea3n: Cung c\u1ea5p m\u1ee9c \u0111\u1ed9 d\u1ecbch v\u1ee5 v\xe0 tr\u1ea3i nghi\u1ec7m v\xf4 song v\u1ec1 m\u1ecdi m\u1eb7t.',"Th\u1eddi gian \u1edf b\xean Aman gi\u1ed1ng nh\u01b0 \u0111\u01b0\u1ee3c ch\xe0o \u0111\xf3n v\xe0o m\u1ed9t ng\xf4i nh\xe0 ri\xeang sang tr\u1ecdng, n\u01a1i ch\u1ec9 ti\u1ebfp \u0111\xf3n m\u1ed9t v\xe0i v\u1ecb kh\xe1ch. B\u1ea5t \u0111\u1ed9ng s\u1ea3n Aman \u0111\u01b0\u1ee3c ki\u1ebfn t\u1ea1o m\u1ed9t c\xe1ch to\xe0n di\u1ec7n v\xe0 ph\xe1t tri\u1ec3n m\u1ed9t c\xe1ch t\u1ef1 nhi\xean, ki\u1ebfn tr\xfac lu\xf4n \u0111\xfang v\u1edbi t\u1eebng \u0111i\u1ec3m \u0111\u1ebfn. C\xe1c khu b\u1ea3o t\u1ed3n v\xe0 kh\xf4ng gian k\xedn \u0111\xe1o r\u1ea5t nh\u1ea1y c\u1ea3m v\xe0 x\xe1c th\u1ef1c v\u1ec1 m\u1eb7t \u0111\u1ecba l\xfd, thi\u1ebft k\u1ebf v\xe0 di s\u1ea3n v\u0103n h\xf3a - m\u1ecdi tr\u1ea3i nghi\u1ec7m c\u1ee7a Aman \u0111\u1ec1u nh\u1eb9 nh\xe0ng m\u1edf ra v\u1edbi s\u1ef1 \u0111\u01a1n gi\u1ea3n v\xe0 sang tr\u1ecdng mang l\u1ea1i c\u1ea3m gi\xe1c th\xe2n thu\u1ed9c ngay l\u1eadp t\u1ee9c.","https://www.aman.com/sites/default/files/styles/image_and_text_extra_large/public/2021-01/191-Amangiri_2020_50R0961_AdobeRGB_High-Res_28891.jpg?itok=eeDB4qwy")
B.PQ=new A.p6(null,"Aman m\u1edf ra s\u1ef1 thanh th\u1ea3n. Gi\u1ed1ng nh\u01b0 m\u1ed9t cu\u1ed1n s\xe1ch ch\u01b0a k\u1ec3, Spirit of Aman l\xe0 v\xf4 h\xecnh. Nh\u1eefng c\xe2u chuy\u1ec7n \u0111\u01b0\u1ee3c k\u1ec3 l\u1ea1i v\xe0 l\xe0m phong ph\xfa th\xeam v\u1ec1 v\u0103n h\xf3a, c\u1ed9ng \u0111\u1ed3ng, thi\xean nhi\xean - \u0111\xe2y l\xe0 m\u1ed9t c\xe2u chuy\u1ec7n \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi m\xf4 ph\u1ecfng, nh\u01b0ng do Aman truy\u1ec1n t\u1ea3i, n\xf3 kh\xf4ng th\u1ec3 b\u1eaft ch\u01b0\u1edbc \u0111\u01b0\u1ee3c.\nNh\xe2n vi\xean c\u1ee7a ch\xfang t\xf4i chia s\u1ebb Tinh th\u1ea7n c\u1ee7a Aman m\u1ed9t c\xe1ch duy\xean d\xe1ng trong m\u1ecdi vi\u1ec7c h\u1ecd l\xe0m. Nhi\u1ec1u ng\u01b0\u1eddi trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi t\u1ea1o n\xean Aman nh\u01b0 hi\u1ec7n t\u1ea1i \u0111\xe3 g\u1eafn b\xf3 v\u1edbi ch\xfang t\xf4i ngay t\u1eeb nh\u1eefng ng\xe0y \u0111\u1ea7u v\xe0 35 n\u0103m sau ti\u1ebfp t\u1ee5c g\u1eafn k\u1ebft ch\xfang t\xf4i ch\u1eb7t ch\u1ebd v\u1edbi nhi\u1ec1u c\u1ed9ng \u0111\u1ed3ng t\u1ea1i c\xe1c \u0111i\u1ec3m \u0111\u1ebfn c\u1ee7a ch\xfang t\xf4i. Ch\xfang t\xf4i \u0111\u1eb7t kh\xe1ch h\xe0ng l\xe0 tr\u1ecdng t\xe2m trong m\u1ecdi vi\u1ec7c ch\xfang t\xf4i l\xe0m v\xe0 t\u1ea1o ra m\xf4i tr\u01b0\u1eddng gi\xfap h\u1ecd chuy\u1ec3n \u0111\u1ed5i li\u1ec1n m\u1ea1ch v\xe0 ngay l\u1eadp t\u1ee9c t\u1eeb cu\u1ed9c s\u1ed1ng h\xe0ng ng\xe0y sang tr\u1ea1ng th\xe1i b\xecnh t\u0129nh kh\xf4ng ph\u1ee9c t\u1ea1p.","https://www.aman.com/sites/default/files/styles/image_and_text_extra_large/public/2022-03/Amanjena%2C%20Marrakech%20-%20Aman%20Skincare%2C%20Purifying%20CandleAman%20Skincare%2C%20Ultimate%20Skincare%20Gift%20set-2.jpg?itok=jS1OImOh")
B.PO=new A.p6(null,"Aman hi\u1ec7n qu\u1ea3n l\xfd 34 d\u1ef1 \xe1n ph\xe1t tri\u1ec3n kh\xe1ch s\u1ea1n, khu ngh\u1ec9 d\u01b0\u1ee1ng v\xe0 nh\xe0 \u1edf t\u1ea1i 20 qu\u1ed1c gia, 15 trong s\u1ed1 \u0111\xf3 n\u1eb1m g\u1ea7n ho\u1eb7c trong c\xe1c \u0111\u1ecba \u0111i\u1ec3m \u0111\u01b0\u1ee3c UNESCO b\u1ea3o v\u1ec7. \u0110\xfang nh\u01b0 tinh th\u1ea7n ti\xean phong c\u1ee7a th\u01b0\u01a1ng hi\u1ec7u, cho \u0111\u1ebfn nay, th\xeam m\u01b0\u1eddi d\u1ef1 \xe1n n\u1eefa \u0111\xe3 \u0111\u01b0\u1ee3c c\xf4ng b\u1ed1 nh\u01b0 m\u1ed9t ph\u1ea7n c\u1ee7a k\u1ebf ho\u1ea1ch ph\xe1t tri\u1ec3n m\u1ea1nh m\u1ebd trong t\u01b0\u01a1ng lai.","https://www.aman.com/sites/default/files/styles/image_and_text_extra_large/public/2023-03/Amankora%2C%20Bhutan%20-%20Journeys%20Landscape.jpg?itok=yX8OFBpT")
